function remove_gee(path){
    if (/^var \$[^ ]+ *= *[^\.]+\.\$_CX;/.test(path+'')){
        for (var i = 0; i < 5; i++) {
            path.parentPath.node.body.shift()
        }
    }
}

function replacer_for(path){
    var v = generator(path.node.test).code
    if (v.indexOf('lTloj.$_DP()') != -1){
        var ls = path.node.body.body[0].cases
        var na = path.node.body.body[0].discriminant.name
        var ne = []
        for (var i = 0; i < ls.length; i++) {
            var _n = ls[i].consequent
            if (!_n.length){ continue }
            _n.pop()
            if (generator(_n[_n.length-1]).code.indexOf(na) == 0){
                _n.pop()
            }
            ne = ne.concat(_n)
        }
        path.replaceWithMultiple(ne)
        path.parentPath.node.body.shift()
        // console.log()
    }
}

function muti_process_test(jscode){
    var ast = parser.parse(jscode);

    traverse(ast, {CallExpression: replacer_gee})
    traverse(ast, {ForStatement: replacer_for})
    traverse(ast, {VariableDeclaration: remove_gee})

    var code = generator(ast, { jsescOption: { minimal: true, } }).code;
    return code;
}
